(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[3996],{3996:function(e){"use strict";e.exports=JSON.parse('{"md":"\\n# Revision\\n\\nA revision contains properties linked to an App. As these properties changes, we can track revisions and compare changes\\n\\n| Field | Description | Type | Reference | Nullable | Deprecated |\\n|-------|-------------|------|-----------|----------|------------|\\n| id | Revision ID | ID | [ID](/api-docs/id) | No | No |\\n| app | App | App | [App](/api-docs/app) | No | No |\\n| name | Revision Name | String | [String](/api-docs/string) | No | No |\\n| locked | Revision has been finalised and locked to prevent further changes | Boolean | [Boolean](/api-docs/boolean) | No | No |\\n| tags | Get all the tags linked to this revision | List[Tag] | [Tag](/api-docs/tag) | No | No |\\n| global_triggers | Get all the global triggers linked to this revision | List[Trigger] | [Trigger](/api-docs/trigger) | No | No |\\n| global_action_group_distributions | Get all the global triggers linked to this revision | List[ActionGroupDistribution] | [ActionGroupDistribution](/api-docs/action-group-distribution) | No | No |\\n| app_platform_revisions | Get all the `AppPlatformRevision`&#039;s linked to this revision | List[AppPlatformRevision] | [AppPlatformRevision](/api-docs/app-platform-revision) | No | No |\\n| created_at | Revision Creation Time | DateTime | [DateTime](/api-docs/date-time) | No | No |\\n| updated_at | Revision Last Update Time | DateTime | [DateTime](/api-docs/date-time) | No | No |\\n| event_request_stats | Event request stats - Please note that revision is automatically set in the filter options | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n\\n## Queries\\n\\n*Queries provide a function on the graph to access Revision entities. This should be considered the same as RESTful \'GET\'*\\n\\n---\\n\\n### Get Revision\\n\\n```graphql\\ngetRevision(id: ID!): Revision\\n\\n```\\n\\nFinds a Revision By Id\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| id | -- | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Revision | [Revision](/api-docs/revision) |\\n\\n\\n\\n\\n---\\n\\n### Revision Difference\\n\\n```graphql\\nrevisionDifference(leftRevisionId: ID!, rightRevisionId: ID!): [RevisionDiff]\\n\\n```\\n\\nProvides the left and right comparison of two revisions\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| leftRevisionId | -- | ID | [ID](/api-docs/id) | Yes |  | No |\\n| rightRevisionId | -- | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| List[RevisionDiff] | [RevisionDiff](/api-docs/revision-diff) |\\n\\n\\n\\n\\n## Mutations\\n\\n*Mutations enable us to create, modify and delete Revision entities. POST/PUT/DELETE methods in a RESTful API would typically provide this functionality*\\n\\n---\\n\\n### Duplicate Revision\\n\\n```graphql\\nduplicateRevision(duplicateRevisionInput: DuplicateRevisionInput): Revision\\n\\n```\\n\\nDuplicate revision will clone any linked items and return a new revision\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| duplicateRevisionInput | -- | DuplicateRevisionInput | *DuplicateRevisionInput* | No |  | No |\\n\\n\\n**DuplicateRevisionInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| revision_id | ID of the revision to be duplicated | ID | [ID](/api-docs/id) | Yes |  | No |\\n| new_name | Optionally provide a new name for the revision | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Revision | [Revision](/api-docs/revision) |\\n\\n\\n\\n\\n---\\n\\n### Finalise Revision\\n\\n```graphql\\nfinaliseRevision(finaliseRevisionInput: FinaliseRevisionInput): [RevisionIssue]\\n\\n```\\n\\nTo link a revision to an environment it must be &#039;locked&#039;, i.e in its final state\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| finaliseRevisionInput | -- | FinaliseRevisionInput | *FinaliseRevisionInput* | No |  | No |\\n\\n\\n**FinaliseRevisionInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| revision_id | ID of the revision to be finalised | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| List[RevisionIssue] | [RevisionIssue](/api-docs/revision-issue) |\\n\\n\\n\\n\\n---\\n\\n### Update Revision\\n\\n```graphql\\nupdateRevision(revisionUpdateInput: RevisionUpdateInput): Boolean\\n\\n```\\n\\nUpdate a `Revision`&#039;s details.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| revisionUpdateInput | -- | RevisionUpdateInput | *RevisionUpdateInput* | No |  | No |\\n\\n\\n**RevisionUpdateInput**\\n\\n*Update a `Revision`&#039;s properties*\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| revision_id | `Revision` ID to update data against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| name | `Revision` name | String | [String](/api-docs/string) | No |  | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n"}')}}]);